import {Routes, Route} from "react-router-dom";

function Dashboard () {



    return(
        <>
            <div className="Navbar-dashboard">
                <NavBar/>
            </div>
            <div>
                <h1>Top 10 Indian Stocks</h1>
                <table>
                    <thead>
                    <tr>
                        <th>Symbol</th>
                        <th>Price</th>
                    </tr>
                    </thead>
                    <tbody>
                    {stocks.map((stock) => (
                        <tr key={stock.symbol}>
                            <td>{stock.symbol}</td>
                            <td>{stock.price}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        </>


    );
}

export default Dashboard;
